export const Menu = () => {
    return (
        <div>
            <h1>Menu</h1>
            <nav>
                <ul>
                    <li><a href="/eventos">Eventos</a></li>
                    <li><a href="/cadastro">Cadastro</a></li>
                    <li><a href="/login">Login</a></li>
                </ul>
            </nav>
        </div>
    );
}
